document.getElementById('mediaCardForm').addEventListener('submit', function(event) {
    event.preventDefault();

    const name = document.getElementById('name').value;
    const company = document.getElementById('company').value;
    const headshotInput = document.getElementById('headshot');
    const headshotFile = headshotInput.files[0];
    const backgroundSelection = document.querySelector('input[name="background"]:checked').value;

    const backgroundImages = {
        background1: 'data:image/jpeg;base64,',
        background2: 'data:image/jpeg;base64,',
        background3: 'data:image/jpeg;base64,'
    };


    if (headshotFile) {
        const reader = new FileReader();
        reader.onload = function(event) {
            const img = new Image();
            img.onload = function() {
                // Load selected background image from base64 string
                const backgroundImg = new Image();
                backgroundImg.onload = function() {
                    const canvas = document.getElementById('mediaCardCanvas');
                    const ctx = canvas.getContext('2d');
                    const canvasWidth = canvas.width;
                    const canvasHeight = canvas.height;

                    // Clear canvas
                    ctx.clearRect(0, 0, canvas.width, canvas.height);

                    // Calculate adjusted canvas dimensions to match aspect ratio of background image
                    const aspectRatio = backgroundImg.width / backgroundImg.height;
                    let canvasWidthAdjusted = canvasWidth;
                    let canvasHeightAdjusted = canvasHeight;
                    
                    if (canvasWidthAdjusted / aspectRatio > canvasHeightAdjusted) {
                        canvasWidthAdjusted = canvasHeightAdjusted * aspectRatio;
                    } else {
                        canvasHeightAdjusted = canvasWidthAdjusted / aspectRatio;
                    }

                    // Draw background image maintaining its aspect ratio
                    ctx.drawImage(backgroundImg, (canvasWidth - canvasWidthAdjusted) / 2, (canvasHeight - canvasHeightAdjusted) / 2, canvasWidthAdjusted, canvasHeightAdjusted);

                    // Draw headshot, name, and company
                    const imgSize = 300; // Size of the headshot
                    const padding = 90; // Adjust this value to set the left margin
                    const textPadding = 45; // Padding between the headshot and the text
                    const headshotX = padding; // X-coordinate for the headshot
                    const headshotY = (canvasHeightAdjusted - imgSize) / 2 + 110; // Y-coordinate for the headshot

                    // // Draw headshot with white border
                    // ctx.fillStyle = 'white';
                    // ctx.fillRect(headshotX - 5, headshotY - 5, imgSize + 10, imgSize + 10);
                    // ctx.drawImage(img, headshotX, headshotY, imgSize, imgSize);

                    // Set the size of the border
                    const borderSize = 8;

                    // Disable shadow for border and headshot
                    ctx.shadowColor = 'transparent';

                    ctx.fillStyle = 'white';
                    // Draw the border with the new size
                    ctx.fillRect(headshotX - borderSize, headshotY - borderSize, imgSize + 2 * borderSize, imgSize + 2 * borderSize);
                    ctx.drawImage(img, headshotX, headshotY, imgSize, imgSize);

                    // Enable shadow for text
                    ctx.shadowColor = 'rgba(0, 0, 0, 0.7)';
                    ctx.shadowOffsetX = 4;
                    ctx.shadowOffsetY = 4;
                    ctx.shadowBlur = 10;
                    // ctx.shadowColor = 'rgba(0, 0, 0, 0.7)';
                    // ctx.shadowOffsetX = -2;
                    // ctx.shadowOffsetY = 2;
                    // ctx.shadowBlur = 4;

                    // Set text styles
                    ctx.fillStyle = 'white';
                    ctx.font = 'bold 55px Arial';
                    ctx.textBaseline = 'top';

                    // Calculate text positions
                    const textX = headshotX + imgSize + textPadding;

                    const nameLines = breakTextIntoLines(name, 20);
                    const companyLines = breakTextIntoLines(company, 30);

                    const lineHeight = 45;
                    const companyLineHeight = 40;

                    const totalTextHeight = (nameLines.length * lineHeight) + (companyLines.length * companyLineHeight) + 10; // 10px for spacing between name and company

                    let textY = headshotY + (imgSize - totalTextHeight) / 2;

                    // Draw name
                    for (let line of nameLines) {
                        ctx.fillText(line, textX, textY);
                        textY += lineHeight;
                    }

                    // Draw company
                    ctx.font = '50px Arial';

                    textY += 30; // Add spacing between name and company
                    
                    for (let line of companyLines) {
                        ctx.fillText(line, textX, textY);
                        textY += companyLineHeight;
                    }

                    // Prepare download link
                    const downloadLink = document.getElementById('downloadLink');
                    // Set the image format to JPEG and quality to 0.8 (80%)
                    downloadLink.href = canvas.toDataURL('image/jpeg', 0.8);
                    downloadLink.download = `${name}-media_card.jpg`;
                    downloadLink.style.display = 'block';
                    downloadLink.textContent = 'Download Media Card';

                    // Display canvas
                    canvas.style.display = 'block';
                };
                backgroundImg.src = backgroundImages[backgroundSelection];
            };
            img.src = event.target.result;
        };
        reader.readAsDataURL(headshotFile);
    }
});

// Function to break text into lines by words
function breakTextIntoLines(text, maxCharactersPerLine) {
    const words = text.split(' ');
    const lines = [];
    let line = '';
    for (let word of words) {
        if ((line + word).length <= maxCharactersPerLine) {
            line += (line === '' ? '' : ' ') + word;
        } else {
            lines.push(line);
            line = word;
        }
    }
    if (line !== '') {
        lines.push(line);
    }
    return lines;
}
